function ProjectCard({ project }) {
    return (
      <div className="bg-white rounded-lg shadow-md overflow-hidden">
        <img src={project.image} alt={project.title} className="w-full h-92 object-cover" />
  
        <div className="p-4">
          <h2 className="text-xl font-bold mb-2">{project.title}</h2>
  
          <p className="text-gray-600 mb-4">{project.description}</p>
  
          <ul className="mb-4">
            {project.technologies.map((tech) => (
              <li key={tech} className="inline-block bg-primarypink rounded-full text-gray-700 px-3 py-1 text-sm font-semibold mr-2 mb-2">
                {tech}
              </li>
            ))}
          </ul>
  
          <div className="flex justify-between">
            
  
            <a href={project.githubUrl} target="_blank" rel="noopener noreferrer" className="bg-pink-400 text-white px-4 py-2 rounded-md hover:bg-pink-300 transition-colors duration-300">
              Vedi su Github
            </a>
          </div>
        </div>
      </div>
    );
  }
  
  export default ProjectCard;
